import './Borrow.css';

function Borrow(){
    const curr_date = new Date(2022, 4, 13);



    return( 
    <div>
        <div className='box'>
            <div className='date_box'>{curr_date}</div>
        </div>        
        <div className='box'>Nane: Aamir</div>
        <div className='box'>Amount: </div>
        <div className='box'>SSN/PAN: </div>
        <div className='box'>Term: </div>
        <div className='box'>Credit Score: </div>
        
    </div>
    );
}

export default Borrow;
